    def getFingerprint(self):
        rand = random.choice(self.fingerprints)
        rand['components'] = self.createDict(rand['hash'], rand['components'])
        return rand


    def createDict(self, hash, components):
        data = {}
        data['result'] = hash
        values = components.split('&')
        for val in values:
            sval = val.split('=')
            data[sval[0]] = sval[1]

        return data

